import { Counter } from "./components/Counter";
import Sheet from './components/Sheet';
import { FetchData } from "./components/FetchData";
import { Home } from "./components/Home";

const AppRoutes = [
  {
        index: true,
        element: <Home />
  },
  {
    path: '/counter',
    element: <Counter />
  },
  {
    path: '/fetch-data',
    element: <FetchData />
    },
  {
      path: '/display',
      element: <Sheet />
    }
];

export default AppRoutes;
